import { BrowserRouter, Routes, Route, } from "react-router-dom";

import './App.css';

import HomePage from '../pages/homePage/homePage';
import GamesPage from '../pages/gamesPage/gamesPage';
import SingleGamePage from "../pages/singleGame/singleGamePage";
import Navbar from "../components/navbar/navbar";
import Header from "../components/header/header";
import Footer from "../components/footer/footer";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route index element={<Header />} />
        <Route path="*" element={<></>} />
      </Routes>
      <Navbar />
      <Routes>
          <Route index element={<HomePage />} />
          <Route path="/videogames/*" element={<GamesPage />} />
          <Route path='/videogame/:title' element={<SingleGamePage />} />
          <Route path='/log-in' element={<div>log in</div>} />
          <Route path='/sign-up' element={<div>sign-up</div>} />
        <Route path="*" element={<div>wrong url</div>} />
      </Routes>
      <Footer />
    </BrowserRouter>
  )
}

export default App;
